import React, { Component } from 'react';
import { Link } from 'react-router-dom';
import './App.css';
import '../src/components/Footer';

class App extends Component {
  render() {
    return (
      <div className="App">
        <img src="https://img.icons8.com/nolan/64/video-playlist.png" alt="logo"/>
        <div className="titles">
          <h1>
            Player<br />Video
          </h1>
          <h2>
            To Upload. To compress. To view video files.
          </h2>
        </div>
        <footer className="footer">
              <p className="footer-contact-text">Presented by <span><a href="https://github.com/SYB-SFLA">Sophie BAYRAM</a></span></p>
        </footer>
        {/* <Footer /> */}
      </div>
    );
  }

}

export default App;
